/* Table Deparments */
DROP TABLE IF EXISTS departments;
CREATE TABLE IF NOT EXISTS departments( `id` int(11) NOT NULL AUTO_INCREMENT, `name` varchar(255) NOT NULL, PRIMARY KEY (`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1;


/* Table Cities */
DROP TABLE IF EXISTS cities;
CREATE TABLE IF NOT EXISTS cities( `id` int(11) NOT NULL AUTO_INCREMENT, `name` varchar(255) NOT NULL, `slug` varchar(255) NOT NULL, `department_id` int(11) NOT NULL, PRIMARY KEY (`id`), FOREIGN KEY (`department_id`) REFERENCES departments(`id`)) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT=1 ;;

